import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      username: "",
      password: ""
    };
  }
  // fetch api here
  // componentDidMount() {
  //   fetch("http://127.0.0.1:8000/api/test").then(function(response) {
  //     response.json().then(function(resp) {
  //       console.log(resp);
  //     });
  //   });
  // }
  submit() {
    console.log(this.state);
    fetch('http://127.0.0.1:8000/oauth/token', {
      method: 'post',
      body: JSON.stringify(
          this.state
      ),
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      }
    }).then(function (response) {
      response.json().then(function (resp) {
        console.log(resp)
      })
    })
  }

  render() {
    return (
      <div className="App">
        <h1>Test api</h1>
        <input type="text" onChange={(item)=>{this.setState({username:item.target.value})}}/>
        <input type="password" onChange={(item)=>{this.setState({password:item.target.value})}}/>
        <button onClick={()=>{this.submit()}}>Login</button>
      </div>
    );
  }
}

export default App;
